/*************************************************************************/

DROP TABLE airport;

CREATE TABLE airport  (	code CHAR(3), name CHAR(20),
			city CHAR(50), county CHAR(50), state CHAR(2),
			latitude1 CHAR(30), latitude2 CHAR(30),
			longitude1 CHAR(30), longitude2 CHAR(50), 
			elevation CHAR(10), telephone CHAR(20),
			PRIMARY KEY(code));

